import React from 'react';

import './style.css';


function MoldeBarraDePesquisa() {
    return (

        <div className="feed">
            
            <header className="header_feed">
                <input type="text" placeholder="O que você procura?" />
            </header>
          
        </div>

    )
}

export default MoldeBarraDePesquisa;
